import React from 'react'

const Feedback = () => {
    return (
        <div className="card h-100">
            <div className="card-header">
                <h2>Плохой отзовик VS хороший</h2>
            </div>
            <div className="card-body">
                <p className="lead">
                Плохой отзовик VS хороший
                </p>
            </div>
        </div>
    )
}

export default Feedback;
